// CalendarEntryModal.js
import React from 'react';
import './App.css';

const CalendarEntryModal = ({ selectedDate, formData, setFormData, onSave, onClose }) => {
  const today = new Date().toISOString().split('T')[0];
  const selectedISO = new Date(selectedDate).toISOString().split('T')[0];
  const isFutureDate = new Date(selectedISO) > new Date(today);

  const handleChange = (section, field, value) => {
    setFormData(prev => ({
      ...prev,
      [section]: {
        ...prev[section],
        [field]: value
      }
    }));
  };

  return (
    <div className="modal-overlay">
      <div className="modal">
        <h2>Entry for {selectedDate}</h2>

        {isFutureDate && (
          <p style={{ color: 'orange', fontSize: '0.9rem' }}>
            ðŸš« You cannot create entries for future dates.
          </p>
        )}

        {/* Coding */}
        <label>Coding Description:
          <input value={formData.coding?.description || ''} onChange={e => handleChange('coding', 'description', e.target.value)} />
        </label>
        <label>Questions Solved:
          <input type="number" min="0" value={formData.coding?.questions_solved || ''} onChange={e => handleChange('coding', 'questions_solved', parseInt(e.target.value))} />
        </label>
        <label>Tags:
          <input value={formData.coding?.tags?.join(', ') || ''} onChange={e => handleChange('coding', 'tags', e.target.value.split(',').map(tag => tag.trim()))} />
        </label>

        {/* Thesis */}
        <label>Thesis Description:
          <input value={formData.thesis?.description || ''} onChange={e => handleChange('thesis', 'description', e.target.value)} />
        </label>
        <label>Contribution Score:
          <input type="number" min="0" max="10" value={formData.thesis?.contribution_score || ''} onChange={e => handleChange('thesis', 'contribution_score', parseInt(e.target.value))} />
        </label>

        {/* Studies */}
        <label>Studies Description:
          <input value={formData.studies?.description || ''} onChange={e => handleChange('studies', 'description', e.target.value)} />
        </label>
        <label>Study Score:
          <input type="number" min="0" max="10" value={formData.studies?.study_score || ''} onChange={e => handleChange('studies', 'study_score', parseInt(e.target.value))} />
        </label>

        {/* Applications */}
        <label>Applications Description:
          <input value={formData.applications?.description || ''} onChange={e => handleChange('applications', 'description', e.target.value)} />
        </label>

        {/* Projects */}
        <label>Project Description:
          <input value={formData.projects?.description || ''} onChange={e => handleChange('projects', 'description', e.target.value)} />
        </label>
        <label>Project Contribution Score:
          <input type="number" min="0" max="10" value={formData.projects?.contribution_score || ''} onChange={e => handleChange('projects', 'contribution_score', parseInt(e.target.value))} />
        </label>

        {/* Notes */}
        <label>Notes:
          <textarea rows="3" value={formData.notes || ''} onChange={e => setFormData(prev => ({ ...prev, notes: e.target.value }))} />
        </label>

        <div className="modal-actions" style={{ justifyContent: 'space-between', flexDirection: 'row-reverse' }}>
          <button onClick={onSave} disabled={isFutureDate}>Save</button>
          <button onClick={onClose}>Cancel</button>
        </div>
      </div>
    </div>
  );
};

export default CalendarEntryModal;
